import React from 'react';

const Logo = ({ className = "h-6" }) => {
  return (
    <div className={`flex items-center ${className}`}>
      <img 
        src="/logo.png" 
        alt="Karpaga Vinayaga Educational Group" 
        className="h-full w-auto object-contain"
        onError={(e) => {
          // Fallback to CSS logo if image fails to load
          e.target.style.display = 'none';
          e.target.nextSibling.style.display = 'block';
        }}
      />
      {/* Fallback CSS logo (hidden by default) */}
      <div className="relative hidden">
        {/* Main logo container */}
        <div className="flex bg-blue-800 text-white rounded-lg overflow-hidden shadow-md">
          {/* Left section - Main name */}
          <div className="px-4 py-2">
            <div className="text-center">
              <div className="text-lg font-serif font-bold leading-tight">
                KARPAGA
              </div>
              <div className="text-lg font-serif font-bold leading-tight">
                VINAYAGA
              </div>
            </div>
          </div>
          
          {/* Vertical separator */}
          <div className="w-px bg-white"></div>
          
          {/* Right section - Disciplines */}
          <div className="px-3 py-2">
            <div className="text-xs font-sans font-medium space-y-1">
              <div>MEDICINE</div>
              <div>DENTISTRY</div>
              <div>ENGINEERING</div>
              <div>NURSING</div>
            </div>
          </div>
        </div>
        
        {/* Bottom orange bar */}
        <div className="bg-orange-500 text-white text-xs font-sans font-medium px-4 py-1 text-center rounded-b-lg">
          EDUCATIONAL GROUP
        </div>
        
        {/* Decorative orange swirl */}
        <div className="absolute -top-1 -right-1 w-8 h-8">
          <svg viewBox="0 0 32 32" fill="none" xmlns="http://www.w3.org/2000/svg">
            <path 
              d="M24 4C26 6 28 10 26 16C24 22 18 26 12 24C6 22 4 16 6 12C8 8 12 6 16 8C20 10 22 14 20 18C18 22 14 24 10 22C6 20 4 16 6 12" 
              stroke="#f97316" 
              strokeWidth="2" 
              fill="none" 
              strokeLinecap="round"
            />
          </svg>
        </div>
      </div>
    </div>
  );
};

export default Logo;
